import { BrowserRouter, createBrowserRouter, Route,Routers,RouterProvider } from "react-router-dom";
import Home from "./pages/home/Home";

const router = createBrowserRouter([
  <div>
    <BrowserRouter>
    <Routers>
    <Route path="/" element={<Home/>}></Route>



    </Routers>
    </BrowserRouter>
  </div>
]);

function App() {
  return (
    <div className="app">
      <RouterProvider router={router} />
    </div>
  );
}

export default App;
